      let tangent = vec3.normalize(tangents[i]);
      let bitangent = vec3.normalize(bitangents[i]);
      const dot = vec3.dot(tangent, normal);
      tangent = vec3.normalize(vec3.sub(tangent, vec3.scale(normal, dot)));
